  `usage_status` varchar(50) DEFAULT NULL COMMENT '使用状态',
  `biosafetydata_name` varchar(255) DEFAULT NULL COMMENT '需要采集生物安全数据名称',
  `creator_id` bigint DEFAULT NULL COMMENT '创建者ID',
